import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';

const Navigation = () => {
	return (
		<Navbar collapseOnSelect expand="sm">
			<Navbar.Brand href="/">
				<p>Brunda Raju Fine Arts</p>
			</Navbar.Brand>

			<Navbar.Item href="/about">
				<p>Brunda Raju Fine Arts</p>
			</Navbar.Item>
		</Navbar>
	)
}

export default Navigation;
